export const initialState = {
  writePostLoading: false,
  writePostDone: false,
  postList: [],
};

export const WRITE_POST_LOADING = "WRITE_POST_LOADING";
export const WRITE_POST_SUCCESS = "WRITE_POST_SUCCESS";
export const WRITE_POST_FAILURE = "WRITE_POST_FAILURE";

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case WRITE_POST_LOADING:
      return {
        ...state,
        writePostLoading: true,
      }
    default:
      return state;
  }
};

export default reducer;
